class FaqsComponent {
    constructor(api, router) {
        this.api = api;
        this.router = router;
        this.selected_type = "all";
        this.faqsdata = [];
        this.alldata = [];
        this.getfaqslist();
    }
    ngOnInit() {
    }
    getfaqslist() {
        this.api.getfaqsalllist().subscribe(resp => {
            this.faqsdata = resp['data'];
            this.alldata = resp['data'];
        }, err => {
            console.log(err);
        });
    }
    type_change(type) {
        this.selected_type = type;
        if (type == 'all') {
            this.faqsdata = this.alldata;
        }
        else {
            this.faqsdata = this.alldata.filter((element) => element.Type == type);
        }
    }
    faq_remove(id) {
        this.api.faq_remove(id).subscribe(resp => {
            this.faqsdata = resp['data'];
            this.alldata = resp['data'];
        }, err => {
            console.log(err);
        });
    }
    createfaq() {
        const navData = {
            queryParams: {
                register: true
            }
        };
        this.router.navigate(['addfaq'], navData);
    }
    editfaq(id) {
        const navData = {
            queryParams: {
                id: id,
                register: false
            }
        };
        this.router.navigate(['addfaq'], navData);
    }
}


